end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"173546","type":"CustomJS"},{"attributes":{},"id":"173370","type":"SaveTool"},{"attributes":{},"id":"173481","type":"UnionRenderers"},{"attributes":{},"id":"173408","type":"BasicTicker"},{"attributes":{"source":{"id":"173442"}},"id":"173455","type":"CDSView"},{"attributes":{"active_drag":{"id":"173218"},"active_scroll":{"id":"173219"},"tools":[{"id":"173218"},{"id":"173219"},{"id":"173220"},{"id":"173221"},{"id":"173222"},{"id":"173223"},{"id":"173224"},{"id":"173247"},{"id":"173547"}]},"id":"173226","type":"Toolbar"},{"attributes":{"source":{"id":"173195"}},"id":"173392","type":"CDSView"},{"attributes":{},"id":"173269","type":"Selection"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"173449"}},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"line_color":{"value":null},"top":{"field":"Open"},"width":{"field":"_width"},"x":{"field":"index"}},"id":"173453","type":"VBar"},{"attributes":{"axis":{"id":"173407"},"coordinates":null,"group":null,"t
